import React from "react";

const Footer = () => (
	<div
		className='footer'
		style={{
			backgroundColor: "#0B0C10",
			color: "#66FCF1",
			fontFamily: "Georgia",
			display: "flex",
			justifyContent: "center",
            margin: "auto",
            paddingBottom: "60px"
		}}
	>
		This is some content in sticky footer
	</div>
);

export default Footer;
